import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { UserInterface } from 'src/components/register/register.class';
import { url_api } from 'src/app/app-constants';


@Injectable({
  providedIn: 'root'
})
export class RegisterService {

  constructor (private http: HttpClient) { }

  getUsers(){
    return this.http.get(`${url_api}/api/Users`).subscribe(data => {
      console.log(data);
    });
  }

  PostUsers(data: UserInterface) {
    console.log(data);
    return this.http.post(`${url_api}/api/Users`, data).subscribe();
}


}
